import React from 'react';

const MapContainer = ({ children }) => {
  return (
    <div style={{
      flex: 1,
      position: 'relative',
      width: '100%',
      height: '100%',
      overflow: 'hidden'
    }}>
      {children}
    </div>
  );
};

export default MapContainer;
